  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1：会员订单不显示',
  `add_time` int(11) DEFAULT '0',
  `add_ip` varchar(15) DEFAULT '',
  PRIMARY KEY (`order_id`),
