  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员',
  `room_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '房源id',
  `total_price` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '一共需要支付',
