  `idcard` varchar(18) DEFAULT NULL,
  `enroll_date` varchar(64) NOT NULL DEFAULT '' COMMENT '预约日期',
  `enroll_time` smallint(6) NOT NULL DEFAULT '0' COMMENT '预约时长',
