  `miniapp_id` int(11) DEFAULT '0',
  `authorizer_appid` varchar(32) DEFAULT NULL,
  `authorizer_access_token` varchar(512) DEFAULT NULL,
  `authorizer_refresh_token` varchar(512) DEFAULT NULL,
