  `is_online` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1上架',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `add_time` int(11) DEFAULT '0',
  `add_ip` varchar(15) DEFAULT '',
  `store_id` int(11) unsigned NOT NULL DEFAULT '0',
