INSERT INTO `nm_companygw` VALUES ('185', '河南农码科技有限公司', '34.719519', '113.660865', '河南省郑州市二七区京广路街道航海中路71号合盛百荣广场1', '河南郑州二七区航海路71号', '葛先生', '13949123285', '河南农码科技有限公司是一家以互联网平台运营、WEB应用开发、软件开发、大数据分析、移动互联网通讯技术、云计算、营销推广、技术培训等技术为核心的科技公司。团队成员是由一批具有国内著名网络公司服务背景的网络精英所组成，年轻、富有活力，注定一开始就是一家成熟的科技公司，是一家专业从事网站建设、网站推广和网络营销，小程序开发，微信公众号开发，手机APP开发，软件定制开发的高新互联网技术公司。', '1524149483', '115.60.167.4');
