INSERT INTO `nm_companygw_contents` VALUES ('172', '3', '185', '37', '20180420\\786a7ab9da0bbed55da034656c0fc88c.jpg', '小程序的商业价值\r\n\r\n一.拓展新客源\r\n\r\n搭上微信小程序的大浪潮，顺势为商家引流客源，扩大曝光提升到店率\r\n\r\n二.突出企业品牌\r\n\r\n微信体系内，一键分享，可获千亿市场流量曝光，最大化提升品牌认知度\r\n\r\n三.提高客户满意度\r\n\r\n支持下单、支付及预约，为客户提供便捷化服务，提高用户体验，积累好口碑\r\n\r\n四.了解用户行为\r\n\r\n结构化、图表化的会员数据，让你更了解你的客户，降低流失率', '2', '1524191137', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('171', '3', '185', '37', '20180420\\4da99ea0619ec23ea4790252c6adad5d.png', '小程序是近年最大的移动互联网商机，率先上线小程序，越早进入就越火爆，越先享受新的理念带来的好处，抢占流量红利，实现营收激增。', '1', '1524191137', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('169', '3', '185', '38', '20180420\\297ff1fb1a64570f19b68ab7541e7ecc.png', '企业网站，作为企业形象宣传和展示必备的互联网工具。一个好的企业网站对于企业形象的宣传至关重要。那么，企业怎么做网站呢？\r\n\r\n怎么做企业网站\r\n\r\n网站由三部分构成，网站程序、空间和域名，我们可以把空间比喻成我们的房子，那么域名就是通往我们房子的一条路径，网站程序则是摆放在房中的家具。', '1', '1524191114', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('170', '3', '185', '38', '20180420\\e3a0b2a316f4283513bcccb83234c0c8.png', '了解了企业网站的构成之后，就可以开始自己做企业网站了，首先，进行空间和域名的注册、购买；然后找到一款适合自己的CMS建站系统，目前企业网站用得比较多的CMS建站系统当属农码科技的CMS系统。通过农码科技开发人员开发好的程序进行网站内容的添加，将网站内容修改为公司的相关信息；最后，空间域名做好解析绑定后就可以直接通过域名访问到网站了。', '2', '1524191114', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('167', '3', '185', '39', '20180420\\78f4e380de9606637b6438389314882a.png', '公众号是独立于微信的，需要单独注册然后对微信进行绑定，所以你如果不注册而是直接用你的微信号直接去登陆公众号平台是无法登陆的。公众号的注册（注册参考链接）根据开发需要进行选择公众号的不同类别，注册流程简单，填写基本信息，邮箱激活，信息登记等流程按照官方走完，你就拥有了一个公众号了。', '1', '1524191087', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('168', '3', '185', '39', '20180420\\41730d14b9d25a060784c3ae29784d2d.jpg', '登陆微信的公众平台，微信提供了两种模式，开发和非开发，非开发模式下提供了一些基本的如消息发送，菜单定义等，而开发模式的话，则除了非开发的基本功能，还可以根据微信提供的接口创造更多有趣的功能。需要注意的是，一个微信只能在两种模式择一，选择开发模式，则非开发模式会关闭。意思就是说，假如你选择开发模式，那么如果你想定义菜单，你无法使用微信后台管理系统提供的方便的自定义菜单的功能，而是必须使用微信提供的自定义菜单的接口，通过调用接口来实现。', '2', '1524191087', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('188', '3', '185', '40', '20180420\\7873990373cd19a81df470a46ec70ed2.jpg', '三.ios应用开发\r\n\r\n基于iPhone应用定制开发，结合iPhone本身的用户操作习惯设计，对每个界面的操作体验和每一个像素效果进行推敲，创作IOS平台上各种动态交互特效。帮助客户于 iPhone用户群体中迅速推广产品。', '2', '1526440526', '36.57.152.147');
INSERT INTO `nm_companygw_contents` VALUES ('187', '3', '185', '40', '20180516\\4b0edd1ee7ca14ec00df4b9a11622f62.jpg', '一.手机网站建设\r\n\r\n完全支持 Html 5，无论客户置身海外,旅途，都可通过手机直接浏览企业网站，方便了解公司服务与产品信息，帮助品牌掌控移动设备。我们最大程度优化移动浏览体验与节约流量。\r\n\r\n二.Android应用开发\r\n\r\n基于Android平台app的设计开发，我们具有优秀的跨平台开发经验，提供符合安卓平台特点的设计及开发服务，多分辨率适配设计的良好操作体验。', '1', '1526440526', '36.57.152.147');
INSERT INTO `nm_companygw_contents` VALUES ('175', '1', '185', '26', '20180420\\44f07ecb5f668b835ff516132b58b039.jpg', '我在这里并没有辨明哪种工作方式更好。我只是说明了什么对我有用，并且因此我成为了一名朝九晚五的开发者。我想的就是做完做好我的工作，然后回家做其他事情（比如写博客）。我需要这样做来管住自己的理智。即便你不需要如我这般才能在工作时专心致志，但是你也可以做到朝九晚五！你不必花费很长时间去编程才算是一个优秀的开发者。你只需要深入思考问题，并想做好本职工作。\r\n\r\n我花了很长时间才认识到，我的大脑根本不能负荷这样的工作方式。我无法全程参与 16 个小时的编码会议。我无法通宵达旦地熬夜直到任务完成。我永远不能像 Twitter 上的那些人说的那样“多产”。我做不到。但是，正如我在历经将近 11 年作为一名职业软件开发者之后才意识到的那样，这也没关系！\r\n\r\n这没关系，因为在每天 8 个小时的时间里，我仍然可以表现出色。我仍然可以完成我的工作，并且完成得很好。我仍然可以高效率地领导我的团队。我仍然可以想出有趣的解决方案。我只需要在我设定的分界内完成这些工作。我意识到我并不比那些 Twitter 上的劳模差劲；我只是与众不同。\r\n\r\n我敢打赌，大多数“沉默”的程序员只想着做好自己的工作就回家。这些人不会因为试图解决已经困扰了他们几周的问题而在晚上熬夜。这些人不写博客，不致力于开源项目，也不进行技术会话，甚至对工作能力以外的程序不怎么感兴趣。有时候这些人会被蔑称为是“朝九晚五的开发者”。在这里我要说的是，即使我们朝九晚五，也不意味着我们差劲。\r\n\r\n如果你是一名朝九晚五的开发人员，那么说明你更擅于时间管理，而并非意味着你低其他程序员一等。', '1', '1524192132', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('176', '1', '185', '27', '20180420\\32e8bc782d101fdecbe0425d57954805.jpg', '河南农码科技有限公司是一家以互联网平台运营、WEB应用开发、软件开发、大数据分析、移动互联网通讯技术、云计算、营销推广、技术培训等技术为核心的科技公司。团队成员是由一批具有国内著名网络公司服务背景的网络精英所组成，年轻、富有活力，注定一开始就是一家成熟的科技公司，是一家专业从事网站建设、网站推广和网络营销，小程序开发，微信公众号开发，手机APP开发，软件定制开发的高新互联网技术公司。\r\n\r\n河南农码科技有限公司致力于全方位向客户提供企业管理信息化解决方案，给客户提供优秀的软件产品和优质售后服务。公司拥有大批资深的专业技术人员、企业咨询顾问和项目管理专家，建立了规模化的产品研发、咨询、销售和服务体系，能够为客户量身打造国际化水准的信息管理平台，为客户提供最具有实效的解决方案。同时采用全线跟踪的服务方式，确保服务的可靠性与安全性，为客户彻底解决信息化建设与实施的后顾之忧。\r\n\r\n公司长期专注于行政事业单位，金融，医疗，移动通讯，物业管理、房地产、市政运营管理等相关行业信息化领域，凭借丰富的系统开发及信息安全服务经验为每一家企事业单位量身定制科学、严谨、符合客户长远利益发展的信息化应用解决方案。', '1', '1524192436', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('177', '1', '185', '28', '20180420\\1321e818b97da5b7d91685e8292bf3f8.jpg', 'php主流框架有哪些？\r\n\r\n一直以来php框架被广泛利用，多半都是基于mvc架构模式的，还有基于事件驱动模式的，在这里，php中文网为大家推荐几个主流的php框架。\r\n\r\nCodelgniter 　　Codelgniter 以它的简单易用，性能和速度而闻名。与 Symphony 不同，这款PHP开发框架对于共享主机的用户而言很理想，如果你想有一个小型覆盖面的框架。它提供了简单的解决方案，还有扩展的知识库，通过视频教程，用户指南和wiki来提供支持。\r\n\r\nThinkphp 　　ThinkPHP是一个性能卓越并且功能丰富的轻量级PHP开发框架，本身具有很多的原创特性，并且倡导大道至简，开发由我的开发理念，用最少的代码完成更多的功能，宗旨就是让WEB应用开发更简单、更快速。从1.*版本开始就放弃了对PHP4的兼容，因此整个框架的架构和实现能够得以更加灵活和简单。2.0版本更是在之前的基础上，经过全新的重构和无数次的完善以及改进，达到了一个新的阶段，足以达到企业级和门户级的开发标准。国人开发的PHP框架，目前最新版本为5.0系列版本。\r\n\r\nYii 　　Yii 是一个基于组件、用于开发大型 Web 应用的 高性能 PHP 框架。它将 Web 编程中的可重用性发挥到极致，能够显著加速开发进程。Yii（读作“易”），代表简单(easy)、高效(efficient)、可扩展(extensible)。\r\n\r\nCakePHP 　　CakePHP 无论对于初学者还是职业PHP开发者都是很好的选择。它基于与Ruby on Rails同样的原则而设计，它十分注重快速开发——这使得它成为一个非常好的用于RAD的开发框架。它快速增长的支持系统，简洁性和可测量性使得CakePHP成为今天可用的最受欢迎的PHP开发框架之一。\r\n\r\nLaravel 框架\r\n\r\n最热门和功能强大的 PHP 开发框架之一是 Laravel。许多 Web 开发人员根据业务需求喜欢使用此框架来构建大型企业的业务 Web 解决方案。此框架支持强大的控制器，slim restful 原型，简单的 JSON api，等等。', '1', '1524196788', '115.60.167.4');
INSERT INTO `nm_companygw_contents` VALUES ('178', '1', '185', '29', '20180420\\ed1dbd135539a09713ef4e489c514952.jpg', '自适应网站与响应式网站有什么区别？哪个好\r\n\r\n随着只能大屏智能手机以及ipad等通讯设备的广泛应用，网站样式风格也与时俱进，在满足PC端计算机的浏览时，移动端同样适合访客浏览，作为一些企业公司和个人，他们在网络营销方面有着更加严格的需求，既要符合网站品牌形象和访客的体验度，又要网站符合搜索引擎规则，进行网站优化等工作，为此针对移动端手机站模式便有了争端，自适应手机站和响应式手机站有什么不同？什么样的手机站更符合企业或个人使用呢？由此指尖时代的的技术顾问来解析一下？\r\n\r\n郑州网站建设.jpg\r\n\r\n一、自适应网站与响应式网站的区别\r\n\r\n1、自适应网站是使用不同设备浏览时呈现不同的网页，网页内容及版式风格或相似或完全不同，和PC端属于不同的网站模板，数据库内容或相同一致，或独立不同，目的在于为了符合访客的浏览。针对一些优化人员，更习惯于做到数据库同步，使PC端的网址和内容与移动端的网址和内容一一对应。\r\n\r\n2、响应式网站是使用不同的设备浏览网站时，网站样式风格、内容和网址都是完全一样的，PC端和移动端属于同一个网站模板，数据库完全一致，也非常符合搜索引擎的优化规则。\r\n\r\n二、自适应网站与响应式网站的好处和弊端\r\n\r\n1、自适应网站和响应式网站各自的好处\r\n\r\n自适应网站可以独立设计，做任何自己想要的风格，还可以做到数据库同步，设计方案灵活，可独立优化符合搜索引擎的规则。响应式网站更加方便浏览，能够增加访客的体验度，无需再单独设计制作手机站，PC站即是手机站，对于优化来讲，权重不分散，更加符合搜索引擎的规则.\r\n\r\n2、自适应网站和响应式网站各自的弊端\r\n\r\n自适应网站的手机站有时无法做到与PC站内容完全一致，且工作量大，自适应手机站往往使用不同的子域名或目录跳转，对于优化来讲权重分散，访客浏览体验仍有缺陷。响应式网设计往往风格有些局限，对于复杂的框架结构难以实现，制作流程复杂，代码兼容性要求较高。\r\n\r\n三、如何选择使用自适应网站还是响应式网站\r\n\r\n1、一般使用自适应网站的手机站主要因为自己在建设手机站之前已经有了PC站，PC站不能做到小屏幕设备适中浏览，又不能进行大改版影响网站优化，故此建设自适应的手机站跳转来实现手机、ipad等符合浏览，手机站数据库一般为同步。成都响应式网站建设我选的成都指尖时代做的服务好 服务专业！\r\n\r\n2、响应式网站往往是建设新站时设计，之前无PC站或手机，不需要顾及网站优化及数据同步，可设计为响应式网站，响应式网站更加符合访客浏览，增加网站体验度，也更符合网站优化工作。', '1', '1524196936', '115.60.167.4');
