INSERT INTO `nm_news` VALUES ('2', '微点应用上线啦', '1', '<p>微点应用是一个第三方小程序托管平台！<br/></p><p><img src=\"/attachs/ueditor/image/20171218/1513558279101748.jpg\" title=\"1513558279101748.jpg\"/></p><p><img src=\"/attachs/ueditor/image/20171218/1513558280780295.jpg\" title=\"1513558280780295.jpg\"/></p><p><br/></p>', '1501920699', '127.0.0.1', '微点应用上线啦');
INSERT INTO `nm_news` VALUES ('3', '一款类似于去哪儿酒店、美团酒店的酒店在线预订的微信小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">酒店在线预订：能快速在线及时预订，无需下载任何软件只需要微信打开就可以！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">优惠券活动：不定期的发放优惠券进行入住的宣传通过微信分享，让用户得到实惠！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\">GPS<span style=\"font-family:宋体\">距离定位：能按照距离查找附近的酒店、方便入住最近的酒店。</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">房源是否可住清晰可查</span>:<span style=\"font-family:宋体\">房源是否有余房可以在线查看，方便快捷</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">5、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">退款方便：退款支持直接退回用户微信余额，只需要点击一个按钮</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">6、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">多酒店入住：酒店可以在线管理自己的房屋状态以及查看资金流水</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">品牌连锁酒店：品牌连锁酒店可以将自己的酒店资源利用小程序来进行附近的店营销！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">拥有酒店资源的创业者：有资源一定要接入到互联网，适用老的一套方法虽然现在能赚钱，但是始终需要被趋势所取代！拥抱互联网，最快最便捷的入口微信小程序势在必行！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">旅行社：旅行社也可以单独的做一款酒店在线预订的程序，这样可以方便的将自己的资源最大化利益！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">其他创业者：想在旅游行业创业，但是资源和资金，甚至方向还不明确的可以使用小程序先行尝试，最小的代价迈出自己的人生第一步！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">为什么要做酒店小程序：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信小程序旅游行业在小程序的流量占比已经达到了惊人的</span>7%<span style=\"font-family:宋体\">；可以说微信小程序的流量是相当的可观，另外目前旅游行业的小程序建设都不太完善，早点布局对抢占流量是有帮助的！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">像华住、去哪儿、携程等等都在做酒店小程序，他们有自己的</span>APP<span style=\"font-family:宋体\">了为什么还要做酒店小程序呢？原因很简单，微信的流量太庞大了，不得不放下身段拥抱微信！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">小程序有附近的小程序功能以及多大</span>40<span style=\"font-family:宋体\">几个的流量入口，占个位置也要先布局小程序已经成为业内说的做多的一句话了！未来会如何谁都说不好，但是微信一直在增长一直在开放！</span></span></p><p><br/></p>', '1503311875', '36.5.163.28', '酒店预订小程序发布啦');
INSERT INTO `nm_news` VALUES ('4', '一款类似于去哪儿、途牛的在线报名旅游的微信小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">公司和家庭旅游需求的在线采集！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">需要在线采集用户旅游需求和计划的单位都可以使用该小程序！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">为什么要做旅游定制小程序：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信小程序旅游行业在小程序的流量占比已经达到了惊人的</span>7%<span style=\"font-family:宋体\">；可以说微信小程序的流量是相当的可观，另外目前旅游行业的小程序建设都不太完善，早点布局对抢占流量是有帮助的！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">小程序有附近的小程序功能以及多大</span>40<span style=\"font-family:宋体\">几个的流量入口，占个位置也要先布局小程序已经成为业内说的做多的一句话了！未来会如何谁都说不好，但是微信一直在增长一直在开放！</span></span></p><p><br/></p>', '1503312248', '36.5.163.28', '微信旅游定制小程序');
INSERT INTO `nm_news` VALUES ('5', '微信民宿预订小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">标题：一款类似于去途家、一家民宿的民宿在线预订的微信小程序</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">民宿在线预订：能快速在线及时预订，无需下载任何软件只需要微信打开就可以！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">优惠券活动：不定期的发放优惠券进行入住的宣传通过微信分享，让用户得到实惠！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\">GPS<span style=\"font-family:宋体\">距离定位：能按照距离查找附近的民宿、方便入住最近的民宿。</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">房源是否可住清晰可查</span>:<span style=\"font-family:宋体\">房源是否有余房可以在线查看，方便快捷</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">5、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">退款方便：退款支持直接退回用户微信余额，只需要点击一个按钮</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">6、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">多民宿入住：民宿可以在线管理自己的房屋状态以及查看资金流水</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">品牌连锁民宿：品牌连锁民宿可以将自己的民宿资源利用小程序来进行附近的店营销！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">拥有民宿资源的创业者：有资源一定要接入到互联网，适用老的一套方法虽然现在能赚钱，但是始终需要被趋势所取代！拥抱互联网，最快最便捷的入口微信小程序势在必行！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">旅行社：旅行社也可以单独的做一款民宿在线预订的程序，这样可以方便的将自己的资源最大化利益！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">其他创业者：想在旅游行业创业，但是资源和资金，甚至方向还不明确的可以使用小程序先行尝试，最小的代价迈出自己的人生第一步！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">为什么要做民宿小程序：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信小程序旅游行业在小程序的流量占比已经达到了惊人的</span>7%<span style=\"font-family:宋体\">；可以说微信小程序的流量是相当的可观，另外目前旅游行业的小程序建设都不太完善，早点布局对抢占流量是有帮助的！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">像途家、小猪、美团等等都在做民宿小程序，他们有自己的</span>APP<span style=\"font-family:宋体\">了为什么还要做民宿小程序呢？原因很简单，微信的流量太庞大了，不得不放下身段拥抱微信！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">小程序有附近的小程序功能以及多大</span>40<span style=\"font-family:宋体\">几个的流量入口，占个位置也要先布局小程序已经成为业内说的做多的一句话了！未来会如何谁都说不好，但是微信一直在增长一直在开放！</span></span></p><p><br/></p>', '1503312275', '36.5.163.28', '微信民宿预订小程序');
INSERT INTO `nm_news` VALUES ('6', '农家乐官网小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">标题：一款满足农家乐、微型景区的官方网站小程序，可在线预订房源以及游玩项目美食等套餐！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">在线订房：可以在线订购住房信息，及时的在线交易！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">优惠券活动：不定期的发放优惠券进行入住的宣传通过微信分享，让用户得到实惠！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">房源是否可住清晰可查</span>:<span style=\"font-family:宋体\">房源是否有余房可以在线查看，方便快捷</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">退款方便：退款支持直接退回用户微信余额，只需要点击一个按钮</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">5、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">游玩项目：可以在线订购游玩项目及周边美食！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">农家乐官方：这也是农家乐拥抱移动互联网的一个大的机会！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微型景区：可以围绕周边的资源进行互联网化传播！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">景区</span>IT<span style=\"font-family:宋体\">工作者：可以利用自己对互联网的了解通过小程序赚一笔额外收入</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">为什么要做农家乐小程序：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信小程序旅游行业在小程序的流量占比已经达到了惊人的</span>7%<span style=\"font-family:宋体\">；可以说微信小程序的流量是相当的可观，另外目前旅游行业的小程序建设都不太完善，早点布局对抢占流量是有帮助的！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">都说拥抱互联网：拥抱互联网第一步就是需要自己的一个网络名片！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">像华住、去哪儿、携程等等都在做酒店小程序，他们有自己的</span>APP<span style=\"font-family:宋体\">了为什么还要做酒店小程序呢？原因很简单，微信的流量太庞大了，不得不放下身段拥抱微信！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">小程序有附近的小程序功能以及多大</span>40<span style=\"font-family:宋体\">几个的流量入口，占个位置也要先布局小程序已经成为业内说的做多的一句话了！未来会如何谁都说不好，但是微信一直在增长一直在开放！</span></span></p><p><br/></p>', '1503312310', '36.5.163.28', '农家乐官网小程序');
INSERT INTO `nm_news` VALUES ('7', '周边游小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">标题：一款类似于去要出发的线路套餐在线预订的微信小程序</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">酒店在线预订：能快速在线及时预订，无需下载任何软件只需要微信打开就可以！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">优惠券活动：不定期的发放优惠券进行入住的宣传通过微信分享，让用户得到实惠！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\">GPS<span style=\"font-family:宋体\">距离定位：能按照距离查找附近的酒店、方便入住最近的酒店。</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">退款方便：退款支持直接退回用户微信余额，只需要点击一个按钮</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">5、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">套餐线路在线预定：快速的预定套餐线路，让旅游一站式搞定</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">6、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">门票美食预定：可以预定景区的门票、已经周边的美食</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">旅游平台创业者：周边游亲子游已经成为一种周末去哪儿的时尚了</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">旅行社：酒店、门票、线路一站式服务的搞定，让旅行社能够快速的分销自己的上游产品</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">为什么要做周边游小程序：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信小程序旅游行业在小程序的流量占比已经达到了惊人的</span>7%<span style=\"font-family:宋体\">；可以说微信小程序的流量是相当的可观，另外目前旅游行业的小程序建设都不太完善，早点布局对抢占流量是有帮助的！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">像要出发、妈网亲子游等等都在做酒店小程序，他们有自己的</span>APP<span style=\"font-family:宋体\">了为什么还要做酒店小程序呢？原因很简单，微信的流量太庞大了，不得不放下身段拥抱微信！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">小程序有附近的小程序功能以及多大</span>40<span style=\"font-family:宋体\">几个的流量入口，占个位置也要先布局小程序已经成为业内说的做多的一句话了！未来会如何谁都说不好，但是微信一直在增长一直在开放！</span></span></p><p><br/></p>', '1503312340', '36.5.163.28', '周边游小程序');
INSERT INTO `nm_news` VALUES ('8', '装修小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">标题：一款收集本地装修建材企业服务的微信小程序</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">商家搜索：分类可以自定义，收集本地商家，</span>VIP<span style=\"font-family:宋体\">有</span><span style=\"font-family:Calibri\">LOGO</span><span style=\"font-family:宋体\">展示，普通商家文字展示！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">商家名片系统：分享商家的名片可以统计分享数，商家的小程序名片很新颖的一个物件！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\">GPS<span style=\"font-family:宋体\">距离定位：可以按照距离来查询最近的商家。</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">商家预约系统：可以在线对商家进行预约到店功能</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">5、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">拨打电话统计功能：用户拨打电话后会记录拨打过哪些商家，拨打过多少次数！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">6、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">装修招标功能：用户在平台提交装修信息，后台可以分配给多家商家！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">7、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">装修攻略：让用户方便的了解装修过程！</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">8、</span><span style=\";font-family:宋体;font-size:14px\