INSERT INTO `nm_news` VALUES ('11', '头条文章小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">标题：一款类似于今日头条、</span></span><span style=\";font-family:宋体;font-size:14px\">UC<span style=\"font-family:宋体\">头条的</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信小程序</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心功能：</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">纯文章头条</span>:<span style=\"font-family:宋体\">可以发布类似段子之类的头条</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">图文混合的头条</span>:<span style=\"font-family:宋体\">内容排版比较丰富可以图文混排</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">纯视频的头条：可以发布视频头条</span></span></p><p style=\"text-indent:28px\"><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">点赞评论功能：用户可以点赞别人的评论和自己发表评论，增加互动</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">拥有微信公众账号粉丝的用户，可以直接开通头条小程序，可以把更多的内容展现给用户！而且比微信公众账号的</span>H5<span style=\"font-family:宋体\">访问更快速！</span></span></p><p><br/></p>', '1503312458', '36.5.163.28', '头条文章小程序');
INSERT INTO `nm_news` VALUES ('12', '小视频小程序', '1', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">标题：一款专门做视频播放的小程序</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">适用对象：</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">做视频类传播的微信公众账号的小程序绑定。游戏团队等等</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><br/></p>', '1503312488', '36.5.163.28', '小视频小程序');
