西能让您快速的收取商家费用，</span>VIP<span style=\"font-family:宋体\">可以包年服务！</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">小程序截图：</span></span></p><p><br/></p>', '1503312515', '36.5.163.28', '人才招聘小程序');
INSERT INTO `nm_news` VALUES ('14', '如何使用微点应用小程序', '1', '<p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第一步：访问</span>http://xcx.mestudio.cn</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;</p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第二步：点击右上角的注册账号</span></span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;<br/></p><p><img src=\"/attachs/ueditor/image/20171218/1513558512833396.jpg\" alt=\"1513558512833396.jpg\" width=\"770\"/></p><p><br/></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第三步：完成注册后自动登录到用户中心</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第四步：点击我管理的小程序小程序管理</span></span></p><p><img src=\"/attachs/ueditor/image/20170821/1503312801752876.png\" title=\"1503312801752876.png\" alt=\"图片2.png\" width=\"770\"/></p><p><br/></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">然后点击添加小程序</span></span></p><p><img src=\"/attachs/ueditor/image/20170821/1503312836298828.png\" title=\"1503312836298828.png\" alt=\"图片3.png\" width=\"770\"/></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">出现下图这个页面</span></span></p><p><img src=\"/attachs/ueditor/image/20170821/1503312866254250.png\" title=\"1503312866254250.png\" alt=\"图片4.png\" width=\"770\"/></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">扫描绑定授权的小程序后！</span></span></p><p><br/></p><p><img src=\"/attachs/ueditor/image/20170821/1503312908954685.png\" title=\"1503312908954685.png\" alt=\"图片5.png\" width=\"770\"/></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">这里会多一条数据！</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第五步：点击左侧模板商城下的模板商城菜单！会打开如下图</span></span></p><p><img src=\"/attachs/ueditor/image/20170821/1503312947294333.png\" title=\"1503312947294333.png\" alt=\"图片6.png\" width=\"770\"/></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">点击您想要的程序进行试用或者立刻购买</span></span></p><p><img src=\"/attachs/ueditor/image/20170821/1503312981574155.png\" title=\"1503312981574155.png\" alt=\"图片7.png\" width=\"770\"/></p><p><br/></p><p><img src=\"/attachs/ueditor/image/20170821/1503313016615515.png\" title=\"1503313016615515.png\" alt=\"图片8.png\" width=\"770\"/></p><p><br/></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">现在我的小程序后确定试用！</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第六步：返回我管理的小程序</span></span><span style=\";font-family:宋体;font-size:14px\">=<span style=\"font-family:宋体\">》小程序管理</span></span></p><p><img src=\"/attachs/ueditor/image/20170821/1503313053332480.png\" title=\"1503313053332480.png\" alt=\"图片9.png\" width=\"770\"/></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">有个青绿色的戴眼镜的按钮叫管理小程序！</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">点击后会进入</span></span></p><p><br/></p><p><br/></p><p><img src=\"/attachs/ueditor/image/20170821/1503313094883467.png\" title=\"1503313094883467.png\" alt=\"图片10.png\" width=\"770\"/></p><p><br/></p><p><img src=\"/attachs/ueditor/image/20170821/1503313121849494.png\" title=\"1503313121849494.png\" alt=\"图片11.png\"/></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">核心的功能区域，点击上传代码</span></span><span style=\";font-family:宋体;font-size:14px\">&nbsp;&nbsp;<span style=\"font-family:宋体\">可以生成小程序的在线预览的体验版本！</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">在体验版本将内容丰富后可以点击提交腾讯审核！</span></span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">等待审核通过后就可以发布我的小程序！</span></span></p><p><br/></p>', '1503313136', '36.5.163.28', '如何使用微点应用小程序');
INSERT INTO `nm_news` VALUES ('15', '酒店小程序修复详情BUG', '1', '<p>酒店小程序修复详情BUG，原因程序员忘记关闭调试代码！</p><p><br/></p><p>所有已经购买酒店小程序的，请再次上传代码提交审核 覆盖线上！</p>', '1505614574', '36.5.161.87', '酒店小程序修复详情BUG');
INSERT INTO `nm_news` VALUES ('17', '国庆放假通知', '1', '<p>&nbsp; &nbsp; &nbsp; &nbsp;国庆佳节即将到来，根据国务院关于法定节假日的规定和我单位工作实际情况，现将2013年国庆节放假的有关事项通知如下：</p><p>&nbsp; &nbsp; &nbsp;单位放假时间为10月1日到8日，10月9日正常上班。</p><p><br/></p><p>&nbsp; &nbsp; 欢渡国庆，共渡中秋!在这美好日子里，让我们用最真挚的祝福伴您渡过。祝：万事大吉，心想事成!</p>', '1506755308', '36.5.160.124', '国庆放假通知');
INSERT INTO `nm_news` VALUES ('18', '国庆佳节过后微点应用回来有惊喜哦', '1', '<p>国庆佳节过后微点应用回来有惊喜哦&nbsp;</p>', '1363700230', '36.5.160.124', '国庆佳节过后微点应用回来有惊喜哦');
INSERT INTO `nm_news` VALUES ('19', '系统修复通知', '1', '<p>企业官网小程序</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1. 修复解决了方案无法修改，且会自动添加内容</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 2. 修复企业动态无法修改&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 3. 修复首页产品中心的展示，在安卓下无法滚动<br/></p><p>B2C商城小程序</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 1.修复产品展示和详情图片比例不统一 ，现为2:1左右的长方形</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 2.修复首页客服无法激活拨打电话功能</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 3.修复商品在不包邮状态下 无法更改邮费 与邮费自动增加 &quot;00&quot;</p><p><br/></p>', '1507526839', '127.0.0.1', '系统修复通知');
INSERT INTO `nm_news` VALUES ('20', 'b2c商城小程序 修复通知', '1', '<p>B2C商城底层进行了重新架构以及bug修复 请商家重新上传审核&nbsp;</p>', '1508465562', '127.0.0.1', 'b2c商城小程序 修复通知');
